import {createSlice} from "@reduxjs/toolkit";

const initialState = {
  uploadedImages: [
    {
      id: "zc8i234r4",
      src: "data:image/webp;base64,",
    },
    {
      id: "3g6oy2n4d",
      src: "data:image/webp;base64,",
    },
    {
      id: "v371j4m4s",
      src: "data:image/webp;base64,",
    },
    {
      id: "tqigaeqjr",
      src: "data:image/webp;base64,",
    },
    {
      id: "w3aw4dmrj",
      src: "data:image/jpeg;base64,",
    },
    {
      id: "1aqfd0an1",
      src: "data:image/webp;base64,",
    },
  ],
  selectedImages: [],
};

export const gallerySlice = createSlice({
  name: "gallery",
  initialState,
  reducers: {
    upload: (state, action) => {
      state.uploadedImages = [...state.uploadedImages, action.payload];
    },
    sortImages: (state, action) => {
      state.uploadedImages = action.payload;
    },
    toggleSelectImage: (state, action) => {
      const id = action.payload;
      if (state.selectedImages.includes(id)) {
        state.selectedImages = state.selectedImages.filter(
          (selectedId) => selectedId !== id
        );
      } else {
        state.selectedImages.push(id);
      }
    },
  },
});

// Action creators are generated for each case reducer function
export const {upload, sortImages, toggleSelectImage} = gallerySlice.actions;

export const galleryReducer = gallerySlice.reducer;
